import React from "react";
import './nav-bar.css';

function NavBar() {
  return (
    <nav>
      <p className="logo">
        onur<span>yildirim</span>
      </p>
      <ul className="links">
        <li className="link">
          <a href="/">Home</a>
        </li>
        <li className="link">
          <a href="/">Blog</a>
        </li>
        <li className="link">
          <a href="/">Contact</a>
        </li>
        <li className="link">
          <a href="/">About</a>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
